import { StyleSheet, Text, View, TextInput, TouchableOpacity } from 'react-native'
import React, { useState } from 'react'
import Checkbox from 'expo-checkbox'

const SignUpScreen = () => {
    const [userName, setUserName] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [againPassword, setAgainPassword] = useState("");
    console.log(userName, email, password, againPassword)
  return (
    <View style={styles.mainContainer}>
            <Text style={styles.mainHeader}>SignUp Page</Text>
            <Text style={styles.description}>Create New Account</Text>
            <View style={styles.inputContainer}>
                <Text style={styles.labels}>Enter Name</Text>
                <TextInput style={styles.inputStyle} autoCapitalize='none'
                    autoCorrect={false} placeholder="Email or Phone" placeholderTextColor='grey' 
                    value={userName} onChangeText={(acctualData) => setUserName(acctualData)}
                />
            </View>
            <View style={styles.inputContainer}>
                <Text style={styles.labels}>Enter E-Mail</Text>
                <TextInput style={styles.inputStyle} autoCapitalize='none'
                    autoCorrect={false} placeholder="Email or Phone" placeholderTextColor='grey' 
                    value={email} onChangeText={(acctualData) => setEmail(acctualData)}
                />
            </View>
            <View style={styles.inputContainer}>
                <Text style={styles.labels}>Enter Password</Text>
                <TextInput style={styles.inputStyle} autoCapitalize='none'
                    autoCorrect={false} placeholder="Password" placeholderTextColor='grey' secureTextEntry={true}
                    value={password} onChangeText={(acctualData) => setPassword(acctualData)}
                />
            </View>
            <View style={styles.inputContainer}>
                <Text style={styles.labels}>Password again</Text>
                <TextInput style={styles.inputStyle} autoCapitalize='none'
                    autoCorrect={false} placeholder="Password" placeholderTextColor='grey' secureTextEntry={true}
                    value={againPassword} onChangeText={(acctualData) => setAgainPassword(acctualData)}
                />
                <Text style={styles.passwordValidation}>Password matched</Text>
                <Text style={styles.passwordValidation}>Password not matched</Text>
            </View>
            <View style={styles.signupContainer}>
                <TouchableOpacity
                style={ styles.signupButtonStyle }>
                <Text style={styles.buttonText}>Sign Up</Text>
            </TouchableOpacity>
            <View style={styles.wrapper}>
                <Text style={styles.wrapperText}>Already have an account</Text>
                <a style={styles.wrapperLogin}>Click here</a>
            </View>
            </View>
        </View>
  )
}

export default SignUpScreen

const styles = StyleSheet.create({
  mainContainer: {
    height: "100%",
    paddingHorizontal: 30,
    paddingTop: 0,
    backgroundColor: '#F5F5F5',
},
mainHeader: {
    fontSize: 25,
    color: '#344055',
    fontWeight: '500',
    paddingTop: 5,
    textTransform: 'capitalize',
    fontFamily: 'bold',
     
},
description: {
    fontSize: 40,
    color: '#344055',
    fontWeight: '500',
    // color: '#7d7d7d',
    marginBottom: 10,
    lineHeight: 25,
    fontFamily: "bold",
    textAlign: 'center',
    marginTop: 100,
},
inputContainer: {
    margin: 10,
},
labels: {
    fontSize: 18,
    // color: '#7d7d7d',
    marginTop: 10,
    marginBottom: 5,
    lineHeight: 25,
    fontFamily: "regular",
},
inputStyle: {
    borderWidth: 1,
    borderColor: 'rgba(0,0,0,0,0.3)',
    paddingHorizontal: 15,
    paddingVertical: 7,
    borderRadius: 5,
    fontFamily: 'regular',
    fontSize: 18,
    backgroundColor: 'white',
    borderTopColor: 'transparent',
    borderLeftColor: 'transparent',
    borderRightColor: 'transparent',

},
passwordValidation: {
    textAlign: 'right',
    marginRight: 5,
    fontSize: 18,
    color: 'green',
    marginTop: 10,
    marginBottom: 5,
    lineHeight: 25,
    fontFamily: "regular",
},
wrapper: {
    flexDirection: 'row',
    margin: 20,
    // alignItems: 'center',
    // backgroundColor: 'orange',
},
wrapperBox: {
    marginVertical: 'auto',
},
wrapperText: {
    fontSize: 18,
    color: '#7d7d7d',
    // marginLeft: 15,
    textAlign: 'center'
},
buttonStyle: {
    marginTop: 50,
    width: 120,
    height: 50,
    borderRadius: 10,
    marginHorizontal: 'auto',
},
buttonText: {
    fontSize: 20,
    marginHorizontal: 'auto',
    marginVertical: 'auto'
},
signupContainer:{
   margin: 0,
//    backgroundColor: 'red'
},
signupContainerLabel:{
    textAlign: 'center',
    fontSize: 20,
    color: '#7d7d7d',
    marginLeft: 15,
},
signupButtonStyle:{
    marginTop: 30,
    width: 200,
    height: 50,
    borderRadius: 10,
    marginHorizontal: 'auto',
    backgroundColor: '#e47911',
},
wrapperLogin: {
    paddingTop: 4,
    // backgroundColor: 'red',
    fontSize: 18,
    color: 'blue',
    marginLeft: 15,
}
})
